    a solution.
    """
    def newton_raphson(guess):
        if abs(poly(xs, guess)) < 1e-10:
            return guess
        return newton_raphson(guess - poly(xs, guess) / poly(xs[1:], guess))

    if len(xs) % 2 != 0:
