def largest_prime_factor(n: int):
    """Return the largest prime factor of n. Assume n > 1 and is not a prime."""
    # First check if n is divisible by 2
    if n % 2 == 0:
        return max(2, largest_prime_factor(n // 2))
    # If not, then start checking odd numbers starting from 3
    for i in range(3, int(sqrt(n))+1, 2):
        if n % i == 0:
            return max(i, largest_prime_factor(n // i))
    # If n is prime, return n itself
    return n

