def fibfib(n: int):
    if n < 0:
        raise ValueError("n must be non-negative")
    if n == 0 or n == 1:
        return 0
    if n == 2:
        return 1

    # Initialize the array to store the fibfib numbers
    fibfib_arr = [0, 0, 1]

    # Compute the fibfib numbers iteratively using the recurrence relation
    for i in range(3, n+1):
        fibfib_arr.append(fibfib_arr[i-1] + fibfib_arr[i-2] + fibfib_arr[i-3])

    return fibfib_arr[n]

def fibfib(n: int):
    """
    The FibFib number sequence is a sequence similar to the Fibbonacci sequence that's defined as follows:
    fibfib(0) == 0
    fibfib(1) == 0
    fibfib(2) == 1
    fibfib(n) == fibfib(n-1) + fibfib(n-2) + fibfib(n-3).
    Please write a function to efficiently compute the n-th element of the fibfib number sequence.
    """

    if n == 0:
        return 0
    elif n == 1:
        return 0
    elif n == 2:
        return 1
    else:
        fibfib_list = [0, 0, 1]
        for i in range(3, n+1):
            fibfib_list.append(fibfib_list[i-1] + fibfib_list[i-2] + fibfib_list[i-3])
        return fibfib_list[n]

def vowels_count(s):
    vowels = {'a': 1, 'e': 1, 'i': 1, 'o': 1, 'u': 1}
    count = 0
    for i in range(len(s)):
        if s[i] in vowels:
            count += 1
            if i == len(s)-1 and s[i] == 'y':
                count -= 1
    return count

def circular_shift(x, shift):
    """Circular shift the digits of the integer x, shift the digits right by shift
    and return the result as a string. If shift > number of digits, return digits reversed."""
    digits = [int(d) for d in str(x)]  # Convert integer to list of digits
    if shift > len(digits):
        return str(x)[::-1]  # Reverse the digits if shift > number of digits
    else:
        shifted_digits = digits[-shift:] + digits[:-shift]  # Shift the digits right by shift
        return ''.join(str(d) for d in shifted_digits)  # Convert the shifted digits back to a string

def digitSum(s):
    """
    This function takes a string as input and returns the sum of the ASCII codes of upper case characters only.
    """
    total = 0
    for char in s:
        if char.isupper():
            total += ord(char)
    return total

