def hex_key(num):
    """
    Counts the number of hexadecimal digits that are primes.
    """
    primes = set([2, 3, 5, 7, 0xB, 0xD])  # 0xB and 0xD are decimal 11 and 13, respectively
    count = 0
    for digit in num:
        if digit in "0123456789ABCDEF":
            decimal = int(digit, 16)
            if decimal in primes:
                count += 1
    return count

