def maximum(arr, k):
    # create a dictionary to store the frequency of each element in the array
    freq = {}
    for num in arr:
        if num in freq:
            freq[num] += 1
        else:
            freq[num] = 1

    # create a list of unique elements in the array and their frequencies
    unique_nums = [(num, freq[num]) for num in freq]

    # sort the unique elements in descending order by frequency
    unique_nums.sort(key=lambda x: x[1], reverse=True)

    # create a sorted list of the k most frequent elements
    result = []
    for num, freq in unique_nums:
        if len(result) >= k:
            break

        # add the number to the result list and update its frequency
        result.extend([num] * freq)

    # sort the result list
    result.sort(reverse=True)

    return result[:k]

