def collatz(n):
    """
    Given a positive integer n, return the Collatz sequence as a list.
    """
    sequence = [n]
    while n > 1:
        if n % 2 == 0:
            n = n // 2
        else:
            n = 3 * n + 1
        sequence.append(n)
    return sequence

