def is_sorted(lst):
    if len(lst) <= 1:
        return True
    for i in range(1, len(lst)):
        if lst[i] < lst[i-1]:
            return False
        elif lst[i] == lst[i-1] and i+1 < len(lst) and lst[i] == lst[i+1]:
            return False
    return True

def is_sorted(lst):
    if len(lst) <= 1:
        return True

    prev = lst[0]
    for i in range(1, len(lst)):
        if lst[i] < prev:
            return False
        elif lst[i] == prev:
            for j in range(i + 1, len(lst)):
                if lst[j] < lst[i]:
                    return False
                elif lst[j] == lst[i]:
                    continue
                else:
                    break
        prev = lst[i]

    return True

def is_sorted(lst):
    '''
    Given a list of numbers, return whether or not they are sorted
    in ascending order. If list has more than 1 duplicate of the same
    number, return False. Assume no negative numbers and only integers.
    '''

    # Check if list has more than 1 duplicate of the same number
    for i in range(len(lst)):
        if lst.count(lst[i]) > 1:
            return False

    # Check if list is sorted in ascending order
    for i in range(len(lst)-1):
        if lst[i] > lst[i+1]:
            return False

    return True

def intersection(interval1, interval2):
    if interval1[0] > interval1[1] or interval2[0] > interval2[1]:
        return "NO"
    if not (interval1[0] <= interval2[1] and interval2[0] <= interval1[1]):
        return "NO"
    length = max(interval1[0], interval2[0]) - min(interval1[1], interval2[1])
    if length <= 1:
        return "NO"
    for i in range(2, int(length**0.5)+1):
        if length % i == 0:
            return "NO"
    return "YES"

def is_prime(n):
    """
    Helper function to check if a number is prime.
    """
    if n <= 1:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True


def intersection(interval1, interval2):
    """
    Main function to check if the length of intersection of two intervals is a prime number.
    """
    start1, end1 = interval1
    start2, end2 = interval2

    # Check if the two intervals intersect
    if start1 > end2 or start2 > end1:
        return "NO"

    # Find the intersection of the two intervals
    start = max(start1, start2)
    end = min(end1, end2)

    # Calculate the length of the intersection
    intersection_length = end - start + 1

    # Check if the length of the intersection is a prime number
    if is_prime(intersection_length):
        return "YES"
    else:
        return "NO"

def prod_signs(arr):
    """
    You are given an array arr of integers and you need to return
    sum of magnitudes of integers multiplied by product of all signs
    of each number in the array, represented by 1, -1 or 0.
    Note: return None for empty arr.

    Example:
    >>> prod_signs([1, 2, 2, -4]) == -9
    >>> prod_signs([0, 1]) == 0
    >>> prod_signs([]) == None
    """

    if len(arr) == 0:
        return None

    sign = 1
    for x in arr:
        if x < 0:
            sign *= -1
        elif x == 0:
            return 0

    return sign * sum(abs(x) for x in arr)

def minPath(grid, k):
    n = len(grid)
    seen = set()
    min_path = [0] * k

    def dfs(x, y, depth):
        if depth == k:
            min_path[:] = sorted(list(seen))
            return True
        for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < n and 0 <= ny < n and (nx, ny) not in seen:
                seen.add((nx, ny))
                if dfs(nx, ny, depth + 1):
                    return True
                seen.remove((nx, ny))
        return False

    for i in range(n):
        for j in range(n):
            seen.clear()
            seen.add((i, j))
            if dfs(i, j, 1):
                return min_path
    return []

def minPath(grid, k):
    def helper(grid, k, curr_path, visited, min_path):
        if k == 0:
            min_path.append(curr_path[:])
            return

        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if not visited[i][j]:
                    if i > 0 and not visited[i - 1][j]:
                        curr_path.append(grid[i - 1][j])
                        visited[i - 1][j] = True
                        helper(grid, k - 1, curr_path, visited, min_path)
                        visited[i - 1][j] = False
                        curr_path.pop()

                    if j > 0 and not visited[i][j - 1]:
                        curr_path.append(grid[i][j - 1])
                        visited[i][j - 1] = True
                        helper(grid, k - 1, curr_path, visited, min_path)
                        visited[i][j - 1] = False
                        curr_path.pop()

                    if i < len(grid) - 1 and not visited[i + 1][j]:
                        curr_path.append(grid[i + 1][j])
                        visited[i + 1][j] = True
                        helper(grid, k - 1, curr_path, visited, min_path)
                        visited[i + 1][j] = False
                        curr_path.pop()

                    if j < len(grid[0]) - 1 and not visited[i][j + 1]:
                        curr_path.append(grid[i][j + 1])
                        visited[i][j + 1] = True
                        helper(grid, k - 1, curr_path, visited, min_path)
                        visited[i][j + 1] = False
                        curr_path.pop()

    def get_min_path(min_path):
        min_path.sort(key=lambda x: (-len(x), x))
        return min_path[0]

    n = len(grid)
    visited = [[False for _ in range(n)] for _ in range(n)]
    min_path = []
    helper(grid, k, [], visited, min_path)
    return get_min_path(min_path)

def minPath(grid, k):
    def dfs(x, y, length, path):
        if length == k:
            if path < min_path:
                min_path[:] = path[:]
            return

        for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(grid) and 0 <= ny < len(grid[0]) and (nx, ny) not in visited:
                visited.add((nx, ny))
                path.append(grid[nx][ny])
                dfs(nx, ny, length + 1, path)
                path.pop()
                visited.remove((nx, ny))

    min_path = [float('inf')] * k
    visited = set()
    for i in range(len(grid)):
        for j in range(len(grid[0])):
            visited.add((i, j))
            dfs(i, j, 1, [grid[i][j]])
            visited.remove((i, j))

    return min_path

